import React from 'react';
import '../CSS/Home.css';


const Home = () => (
    <div>
          <nav className="navbar">
            <ul className="navbar-list">
                <li className="navbar-item"><a href="/" className="navbar-link">Home</a></li>
                <li className="navbar-item"><a href="/about" className="navbar-link">About</a></li>
                <li className="navbar-item"><a href="/gallery" className="navbar-link">Gallery</a></li>
                <li className="navbar-item"><a href="/contact" className="navbar-link">Contact</a></li>
            </ul>
        </nav>
      <h1 className='hcolour'>Welcome To Birchwood Memories</h1>
      <img src="/Photo on 2023-07-14 at 1.27 AM.jpg" alt="Image Description" style={{ display: 'block', margin: '0 auto', width: '400px', height: 'auto', pad }} />
      <h2>Welcome to Birchwood Memories, a cherished retreat nestled amidst the serene beauty of Rose City, Michigan. Formerly belonging to my beloved grandfather, this enchanting property offers a perfect blend of rustic charm and natural splendor. Surrounded by a picturesque forest adorned with majestic birch, oak, and other magnificent trees, it presents a haven of tranquility where you can escape the hustle and bustle of everyday life. At the heart of this magical setting lies a cozy cabin, offering breathtaking views of a private 12-acre lake. Step into a world where time slows down, and immerse yourself in the beauty of nature, creating unforgettable memories in an ambiance filled with cherished family history. Whether you seek solitude, outdoor adventures, or simply a space to reconnect with loved ones, Birchwood Memories welcomes you with open arms.</h2>

    </div>
  );



export default Home;
